import React, { useState } from 'react';
import { AppBar, Toolbar, Button, Container, Typography, Grid, Card, CardContent, Select, MenuItem, FormControl, InputLabel } from '@mui/material';
import { useNavigate } from 'react-router-dom';

// Recipe type
type Recipe = {
  name: string;
  description: string;
  ingredients: string[];
};

// Recipes by body type
type RecipePlan = {
  ectomorph: Recipe[];
  mesomorph: Recipe[];
  endomorph: Recipe[];
};

// Sample recipe data
const recipes: RecipePlan = {
  ectomorph: [
    {
      name: 'Protein Smoothie',
      description: 'A protein-rich smoothie for muscle mass gain.',
      ingredients: ['200g Greek yogurt', '1 banana', '30g protein powder', '200ml almond milk'],
    },
    {
      name: 'Chicken Pasta',
      description: 'A balanced meal to help with weight gain.',
      ingredients: ['100g whole wheat pasta', '150g grilled chicken', 'Broccoli', 'Olive oil'],
    },
  ],
  mesomorph: [
    {
      name: 'Quinoa Salad',
      description: 'A balanced meal rich in protein and carbs to maintain a healthy weight.',
      ingredients: ['100g quinoa', '100g chicken', 'Avocado', 'Cherry tomatoes', 'Feta cheese'],
    },
    {
      name: 'Vegetable and Tofu Bowl',
      description: 'A vegetarian meal rich in protein.',
      ingredients: ['Tofu', 'Spinach', 'Sweet potato', 'Olive oil', 'Spices'],
    },
  ],
  endomorph: [
    {
      name: 'Vegetable Soup',
      description: 'A low-calorie, high-fiber meal for weight loss support.',
      ingredients: ['Zucchini', 'Carrots', 'Celery', 'Onions', 'Spices'],
    },
    {
      name: 'Spinach and Salmon Salad',
      description: 'A light salad rich in omega-3.',
      ingredients: ['Spinach', '150g salmon', 'Avocado', 'Chia seeds', 'Light dressing'],
    },
  ],
};

const RecipeIdeas: React.FC = () => {
  const [bodyType, setBodyType] = useState<'ectomorph' | 'mesomorph' | 'endomorph'>('ectomorph');
  const navigate = useNavigate();

  const handleHomeClick = () => {
    navigate('/');
  };

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#000', // Black background
      color: '#fff', // White text
      display: 'flex', 
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center', 
      padding: '0', // No padding at the top to align the AppBar correctly
    }}>
      {/* Add Home button to the header bar */}
      <AppBar position="fixed" sx={{ backgroundColor: '#FF9800', width: '100%' }}>
        <Toolbar>
          <Button 
            variant="contained" 
            onClick={handleHomeClick} 
            sx={{ 
              backgroundColor: '#FF9800', 
              color: '#fff', 
              '&:hover': { backgroundColor: '#e68900' } 
            }}
          >
            Home
          </Button>
        </Toolbar>
      </AppBar>

      {/* Spacing to prevent content from being hidden behind the AppBar */}
      <Toolbar />

      <Container 
        sx={{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#fff',
          padding: '150px',
          backgroundColor: 'rgba(255, 255, 255, 0.1)', // Light transparency for standout elements
          borderRadius: '10px',
          marginTop: '20px',
        }}
      >
        <Typography variant="h4" gutterBottom>
          Recipe Ideas for {bodyType.charAt(0).toUpperCase() + bodyType.slice(1)}
        </Typography>

        {/* Body type selection */}
        <FormControl fullWidth sx={{ marginBottom: '20px' }}>
          <InputLabel sx={{ color: '#fff' }}>Body Type</InputLabel>
          <Select
            value={bodyType}
            onChange={(e) => setBodyType(e.target.value as 'ectomorph' | 'mesomorph' | 'endomorph')}
            label="Body Type"
            sx={{ backgroundColor: 'rgba(192, 192, 192, 0.8)', borderRadius: '5px' }}
          >
            <MenuItem value="ectomorph">Ectomorph</MenuItem>
            <MenuItem value="mesomorph">Mesomorph</MenuItem>
            <MenuItem value="endomorph">Endomorph</MenuItem>
          </Select>
        </FormControl>

        <Grid container spacing={3}>
          {recipes[bodyType].map((recipe, index) => (
            <Grid item xs={12} sm={6} key={index}>
              <Card sx={{ backgroundColor: '#333' }}> {/* Cards with dark background */}
                <CardContent>
                  <Typography variant="h6" sx={{ color: '#fff' }}>{recipe.name}</Typography>
                  <Typography sx={{ color: '#ccc' }}>{recipe.description}</Typography>
                  <Typography sx={{ color: '#fff', marginTop: '10px' }}>Ingredients:</Typography>
                  <ul>
                    {recipe.ingredients.map((ingredient, i) => (
                      <li key={i} style={{ color: '#ccc' }}>{ingredient}</li>
                    ))}
                  </ul>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

export default RecipeIdeas;
